    value: In reference to your letter dated April 30, 2013, an amended 12-Day Pre-General
      Report covering the period 10/1/12-10/17/12 is attached.  Item  1.  The transfer
      of $1,487,500 on October 9, 2012 was incorrectly reported as a transfer from
      the Republican National Committee.  The transfer has been changed to the Idaho
      Republican Party.  Item 2.  Consulting Services has been changed to Strategy
      Consulting.  Item 3-Schedule A.   The disbursements on Line 21(b) and 30(b)
      referenced in this RFAI represent volunteer activity that meets the definition
      of Exempt Party Activity as set forth in 11 CFR sections 100.87 and 100.147.  Payments
      for these disbursements were made from federally permissible funds.  None of
      the funds used were designated for a particular candidate, and funds transferred
      from the Republican National Committee were not earmarked for any particular
      program or purpose.  Item 3-Schedule B.  The memo disbursements for Cell Phones-GOTV
      Republican Calls and Chairs for Boehner GOTV Rally have been changed to print
      on Line 30(b).  Even though the payments to the staff members were on one check,
      the payments had to be entered as one payment for operating expenses on Line
      21(b) and one payment as FEA for Line 30(b).  In addition, the coordinated party
      expenditure reported on Schedule F for David Rouzer was incorrectly disclosed
      and has been changed to print on Line 30(b) as Exempt Volunteer Mailing which
      meets the definition of Exempt Party Activity as set forth in 11 CFR sections
      100.87 and 100.147.
